(1, 'hire1', 'CropIn Hiring Challenge 2018', 1526799557, 1527663617, '<strong>This is the 1st Hiring Challenge conducted by CROPIN .</strong>\r\n<strong><br>\r\nGuideLines:<br></strong>\r\n1.) <strong>For Sample Solutions Please Visit this Page : <a href="/hiring/samplesolution.php" target="_blank"> Sample Solution </a></strong><br>\r\n2.)You can see your submissions on the specific Problems page.<br>\r\n3.)Please try to attempt all questions. Your algorithms would be manually analysed later.<br>\r\n4.)Please submit the output as specified in the problem , any extra/no new line might also lead to wrong answer<br>\r\n5.)In case you are not able to see the result of your code , please refresh the Result Page.<br>\r\n6.)Abbreviations of result when submission is done :<br>\r\n            <strong> AC </strong>- Accepted.<br>\r\n            <strong> WA </strong>- Wrong Answer<br>\r\n             <strong> CE </strong>- Compilation Error.<br>\r\n             <strong> PE </strong>-Presentation Error.<br>\r\n              In case no result is shown - </strong>Refresh the Page </strong> or else , contact the admin .\r\n<br><br><br><br>\r\nPlease Let us know about any bugs/problems you find in this platform .<br>\r\nMail us at - manish.kumar@cropin.com\r\n<br>\r\n<strong>Team CROPIN</strong>', NULL, 'notstarted');
