(1526884017, '14.142.111.174', 'Array\n(\n    [url] => /aurora/submit/DUP\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526881020\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => C++\n    [sub] => // C++ program to find\r\n// duplicates in the given array\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\n\r\n// function to find and print duplicates\r\nvoid printDuplicates(int arr[], int n)\r\n{\r\n	// unordered_map to store frequencies\r\n	unordered_map<int, int> freq;\r\n	for (int i=0; i<n; i++)\r\n		freq[arr[i]]++;\r\n\r\n	bool dup = false;\r\n	unordered_map<int, int>:: iterator itr;\r\n	for (itr=freq.begin(); itr!=freq.end(); itr++)\r\n	{\r\n		// if frequency is more than 1\r\n		// print the element\r\n		if (itr->second > 1)\r\n		{\r\n			cout << itr->first << " ";\r\n			dup = true;\r\n		}\r\n	}\r\n\r\n	// no duplicates present\r\n	if (dup == false)\r\n		cout << "NO";\r\n}\r\n\r\n// Driver program to test above\r\nint main()\r\n{\r\nint i,j,t,n,arr[100000];\r\ncin>>t;\r\n\r\nwhile(t--)\r\n{\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {cin>>arr[i];}\r\nprintDuplicates(arr, n);\r\ncout<<endl;\r\n\r\n}\r\nreturn 0;\r\n}\r\n\r\n\n    [probcode] => DUP\n    [submitcode] => Submit\n)\n'),
(1526884057, '106.51.14.214', 'Array\n(\n    [url] => /aurora/submit&edit=66\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526881020\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => C++\n    [sub] => // C++ program to find\r\n// duplicates in the given array\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\n\r\n// function to find and print duplicates\r\nvoid printDuplicates(int arr[], int n)\r\n{\r\n	// unordered_map to store frequencies\r\n	unordered_map<int, int> freq;\r\n	for (int i=0; i<n; i++)\r\n		freq[arr[i]]++;\r\n\r\n	bool dup = false;\r\n	unordered_map<int, int>:: iterator itr;\r\n	for (itr=freq.begin(); itr!=freq.end(); itr++)\r\n	{\r\n		// if frequency is more than 1\r\n		// print the element\r\n		if (itr->second > 1)\r\n		{\r\n			cout << itr->first << " ";\r\n			dup = true;\r\n		}\r\n	}\r\n\r\n	// no duplicates present\r\n	if (dup == false)\r\n		cout << "NO";\r\n}\r\n\r\n// Driver program to test above\r\nint main()\r\n{\r\nint i,j,t,n,arr[100000];\r\ncin>>t;\r\n\r\nwhile(t--)\r\n{\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {cin>>arr[i];}\r\nprintDuplicates(arr, n);\r\ncout<<endl;\r\n\r\n}\r\nreturn 0;\r\n}\r\n\r\n\n    [probcode] => DUP\n    [submitcode] => Submit\n)\n'),
