(1526885311, '106.51.14.214', 'Array\n(\n    [url] => /aurora/submit&edit=67\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526881020\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => C++\n    [sub] => // C++ program to find\r\n// duplicates in the given array\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\n\r\n// Driver program to test above\r\nint main()\r\n{\r\nint i,j,t,n,arr[100000];\r\ncin>>t;\r\n\r\nwhile(t--)\r\n{\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {cin>>arr[i];}\r\n     \r\n    \r\n    for(i=0;i<n;i++)\r\n    {\r\n        if(arr[i]!=-1){\r\n    	for(j=i+1;j<n;j++)\r\n        {\r\n         \r\n            if(arr[i]==arr[j] && arr[j]!=-1)\r\n            {\r\n            	arr[j]=-1;\r\n                cout<<arr[i]<<" ";\r\n            }\r\n        }\r\n        }\r\n    }\r\n    \r\n    \r\ncout<<endl;\r\n\r\n}\r\nreturn 0;\r\n}\r\n\r\n\n    [probcode] => DUP\n    [submitcode] => Submit\n)\n'),
(1526886111, '106.51.14.214', 'Array\n(\n    [url] => /aurora/submit&edit=68\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526881020\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => C++\n    [sub] => // C++ program to find\r\n// duplicates in the given array\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\n\r\n// Driver program to test above\r\nint main()\r\n{\r\nint i,j,t,n,arr[100000],val=0;\r\ncin>>t;\r\n\r\nwhile(t--)\r\n{\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {cin>>arr[i];}\r\n\r\n    int check=0;\r\n    for(i=0;i<n;i++)\r\n    {\r\n        if(arr[i]!=-1){\r\n    	for(j=i+1;j<n;j++)\r\n        {\r\n\r\n            if(arr[i]==arr[j] && arr[j]!=-1)\r\n            {\r\n            	arr[j]=-1;\r\n            	val=1;\r\n               // cout<<arr[i]<<" ";\r\n            }\r\n        }\r\n        if(val==1)\r\n       { cout<<arr[i]<<" ";\r\n       val=0;\r\n       check=1;\r\n       }\r\n        }\r\n    }\r\n    if(check==0)\r\n    cout<<"NO";\r\n\r\n\r\ncout<<endl;\r\n\r\n}\r\nreturn 0;\r\n}\r\n\r\n\n    [probcode] => DUP\n    [submitcode] => Submit\n)\n'),
