(1526889258, '106.51.14.214', 'Array\n(\n    [url] => /aurora/submit/TRAP\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526881020\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => C++\n    [sub] => \r\n#include<bits/stdc++.h>\r\n#define ll long long int\r\n#define max 100000\r\nusing namespace std;\r\nint main() {\r\n\r\n    ll t,n,m,x,y,mini,c1,c2,c3,c4;\r\n    scanf("%lld",&t);\r\n\r\n    while(t--){\r\n\r\n    scanf("%lld",&n);\r\n    scanf("%lld",&m);\r\n    scanf("%lld",&x);\r\n    scanf("%lld",&y);\r\n\r\n\r\n    c1=(abs(x-1)+abs(y-1));\r\n    c2=(abs(x-1)+abs(y-m));\r\n    c3=(abs(x-n)+abs(y-1));\r\n    c4=(abs(x-n)+abs(y-m));\r\n\r\n    mini=c1;\r\n    if(c2<mini)\r\n        mini=c2;\r\n      if(c3<mini)\r\n        mini=c3;\r\n          if(c4<mini)\r\n        mini=c4;\r\n\r\nprintf("%lld\\n",mini);\r\n\r\n    }\r\n    return 0;\r\n}\r\n\n    [probcode] => TRAP\n    [submitcode] => Submit\n)\n'),
(1526895011, '106.51.14.214', 'Array\n(\n    [url] => /aurora/submit/DUP\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526881020\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => C++\n    [sub] => // C++ program to find\r\n// duplicates in the given array\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\n\r\n// function to find and print duplicates\r\nvoid printDuplicates(int arr[], int n)\r\n{\r\n	// unordered_map to store frequencies\r\n	map<int, int> freq;\r\n	for (int i=0; i<n; i++)\r\n		freq[arr[i]]++;\r\n\r\n	bool dup = false;\r\n	map<int, int>:: iterator itr;\r\n	for (itr=freq.begin(); itr!=freq.end(); itr++)\r\n	{\r\n		// if frequency is more than 1\r\n		// print the element\r\n		if (itr->second > 1)\r\n		{\r\n			cout << itr->first << " ";\r\n			dup = true;\r\n		}\r\n	}\r\n\r\n	// no duplicates present\r\n	if (dup == false)\r\n		cout << "NO";\r\n}\r\n\r\n// Driver program to test above\r\nint main()\r\n{\r\nint i,j,t,n,arr[10000];\r\ncin>>t;\r\nfreopen("result.txt","w",stdout);\r\nwhile(t--)\r\n{\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {cin>>arr[i];}\r\nprintDuplicates(arr, n);\r\ncout<<endl;\r\n\r\n}\r\ngetchar();\r\nreturn 0;\r\n}\r\n\r\n\n    [probcode] => DUP\n    [submitcode] => Submit\n)\n'),
(1526895054, '106.51.14.214', 'Array\n(\n    [url] => /aurora/submit&edit=71\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526881020\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => C++\n    [sub] => // C++ program to find\r\n// duplicates in the given array\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\n\r\n// function to find and print duplicates\r\nvoid printDuplicates(int arr[], int n)\r\n{\r\n	// unordered_map to store frequencies\r\n	map<int, int> freq;\r\n	for (int i=0; i<n; i++)\r\n		freq[arr[i]]++;\r\n\r\n	bool dup = false;\r\n	map<int, int>:: iterator itr;\r\n	for (itr=freq.begin(); itr!=freq.end(); itr++)\r\n	{\r\n		// if frequency is more than 1\r\n		// print the element\r\n		if (itr->second > 1)\r\n		{\r\n			cout << itr->first << " ";\r\n			dup = true;\r\n		}\r\n	}\r\n\r\n	// no duplicates present\r\n	if (dup == false)\r\n		cout << "NO";\r\n}\r\n\r\n// Driver program to test above\r\nint main()\r\n{\r\nint i,j,t,n,arr[10000];\r\ncin>>t;\r\n//freopen("result.txt","w",stdout);\r\nwhile(t--)\r\n{\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {cin>>arr[i];}\r\nprintDuplicates(arr, n);\r\ncout<<endl;\r\n\r\n}\r\ngetchar();\r\nreturn 0;\r\n}\r\n\r\n\n    [probcode] => DUP\n    [submitcode] => Submit\n)\n'),
