(1526902392, '14.142.111.174', 'Array\n(\n    [url] => /aurora/submit/TRAP\n    [team] => Array\n        (\n            [id] => 1\n            [name] => judge\n            [status] => Admin\n            [time] => 1526901917\n        )\n\n    [loggedin] => true\n)\n', 'Array\n(\n    [lang] => Java\n    [sub] => import java.io.*;\r\nimport java.lang.*;\r\npublic class Main\r\n{\r\npublic static void main (String[] args) throws java.lang.Exception\r\n{\r\nBufferedReader r = new BufferedReader (new InputStreamReader (System.in));\r\nint t,i,j,c1,c2,c3,c4,mini,n,m,x,y;\r\nt=Integer.parseInt(r.readLine());\r\nwhile(t-->0)\r\n{\r\n	n=Integer.parseInt(r.readLine());\r\n	m=Integer.parseInt(r.readLine());\r\n	x=Integer.parseInt(r.readLine());\r\n	y=Integer.parseInt(r.readLine());\r\n	\r\n	c1=(Math.abs(x-1)+Math.abs(y-1));\r\n    c2=(Math.abs(x-1)+Math.abs(y-m));\r\n    c3=(Math.abs(x-n)+Math.abs(y-1));\r\n    c4=(Math.abs(x-n)+Math.abs(y-m));\r\n\r\n    mini=c1;\r\n    if(c2<mini)\r\n        mini=c2;\r\n      if(c3<mini)\r\n        mini=c3;\r\n          if(c4<mini)\r\n        mini=c4;\r\n	\r\n	System.out.println(mini);\r\n}\r\n}\r\n}\r\n\n    [probcode] => TRAP\n    [submitcode] => Submit\n)\n'),
