(6, 'TRAP', 'Tourist Trap', 'Ad-Hoc', 'contest', 'Active', 'hire1', 'There is a grid of N*M size with top-left cell as (1,1) and bottom-right cell as (N,M).Tourist is stuck inside the grid at (X,Y). There are only 4 exit points in the grid (top-left corner, top-right corner,bottom-left corner,bottom-right corner).<br />Help Tourist to escape the grid by travelling minimum number of cells. <br />Only movements allowed are left ,right,up,down. <br />Note:Once Tourist reaches one of the exit points he is successful in escaping. <br /><strong>Input Format</strong>&nbsp;<br />First line contains T testcases. <br />Then T lines follow.<br /> Each containing 4 integers N,M,X,Y. <br /><strong>Constraints</strong>&nbsp;<br />1&lt;=T&lt;=10^5<br /> 1&lt;=N,<br />M&lt;=10^9 <br />1&lt;=X&lt;=N <br />1&lt;=Y&lt;=M <br /><strong>Output Format</strong><br />&nbsp;Print T lines containing the answer', NULL, NULL, '11\r\n1 1 1 1\r\n10 10 10 10\r\n10 10 1 10\r\n10 10 10 1\r\n1000000 1000000 100 100\r\n50 60 25 26\r\n11 13 5 6\r\n55 22 11 12\r\n33 1000000 22 34\r\n1000000000 1000000000 100000 1000000\r\n1548721523 1524525255 142532 1452563\r\n\r\n', '0\r\n0\r\n0\r\n0\r\n198\r\n49\r\n9\r\n20\r\n44\r\n1099998\r\n1595093\r\n', 0.5, 50, 'C,C++,Java,Python,Python3', NULL, 0, 50000, 2, 12);
